        <p className="fs-5 mb-4 text-muted">
          List of all charges and taxes
        </p>
        <div className="col-4">
          <img src="media/images/" alt="Smallcase" className="img-fluid" />
        </div>
        <div className="col-4"></div>
        <div className="col-4"></div>
      </div>
    </div>
  );
}

export default Hero;
